import re

def find_sequences(data, number_sequences):
    """"""
    result = []
    for (i, data_set) in enumerate(data):
        for sequence in number_sequences:
            for match in re.finditer(sequence, data_set):
                result.append({'sequence': sequence, 'data_set_index': i, 'start_index': match.start(), 'end_index': match.end() - 1})
    return result
